import React from "react";

class DogCard extends React.Component {

  render() {
    return (
      <div>
        <h2 className="bark">{this.props.dog.name}</h2>
        <img alt="" src={this.props.dog.img} />
        <button onClick={() => console.log("clicking")}>Bark</button>
        <h2>Ruff</h2>
      </div>
    );
  }
}

export default DogCard;
